import React from "react";
import M from "materialize-css";

type MyProps = {
  message: string;
};
type MyState = {
  count: number;
};

class Home extends React.Component<MyProps, MyState> {
  state: MyState = {
    count: 2
  }

  render() {
    return (
      <div>
        <M><Materialbox>Hi</Materialbox></M>
        <h1>{this.props.message}: {this.state.count}</h1>
      </div>
    );
  }
}

export default Home;
